    const [currentPage, setCurrentPage] = useState({
        page: 1,
        pageSize: 15,
    });

    useEffect(() => {
        const fetchApi = async () => {
            try {
                const result = await ProductServices.getListProductHome(currentPage, token);
                console.log(result);
                setTotalPage(result?.totalPages);
                setListPost(
                    result?.data?.map((item) => {
                        return {
                            id: item?.id,
                            author_id: item?.userId,
                            author_name: item?.userName,
                            title: item?.name,
                            price: item?.priceBase,
                            ratting: 4.5,
                            amount: 5,
                            image: item?.imageBase,
                            image_avatar:
                                item?.imageAvatarUser ||
                                'https://vietabinhdinh.edu.vn/wp-content/uploads/1679497698_46_1001-ANH-AVATAR-ANIME-dep-chat-va-ca-tinh-LONG.jpg',
                            create_at:
                                moment(item?.updateAt).format('DD/MM/YYYY') ||
                                moment(item?.createAt).format('DD/MM/YYYY'),
                            favorite: false,
                        };
                    }),
                );
            } catch (error) {
                console.log('fetchApi Home.js' + error);
            }
        };
        fetchApi();
    }, [currentPage, token]);

    // useEffect(() => {
    //   setListPost()
    // })

    const handlePageChange = (event, page) => {
        console.log('event', event);
        console.log('page', page);
        setCurrentPage({
            page: page,
            pageSize: 15,
        });
        // setCurrentPage(page);
    };

    return (
        <div className={cx('wrap-content')}>
            <div className={cx('content')}>
                {(listPost || []).map((post) => {
                    return (
                        <Grid item xs={2.4} key={post.id}>
                            <Card post={post} />
                        </Grid>
                    );
                })}
            </div>

            <div className={cx('pagination')}>
                <Pagination
                    count={totalPage}
                    onChange={handlePageChange}
                    sx={{
                        '& button': {
                            minWidth: '50px', // Kích thước to hơn cho các nút Pagination
                        },
                    }}
                />
            </div>
        </div>
    );
